f7=T.l("UPRIGHT: Beginnings, innocence, spontaneity, a free spirit\n\nREVERSED: Holding back, recklessness, risk-taking\n\nThe Fool is numbered 0 \u2013 the number of unlimited potential \u2013 and so does not have a specific place in the sequence of the Tarot cards. The Fool can be placed either at the beginning of the Major Arcana or at the end. The Major Arcana is often considered the Fool\u2019s journey through life and as such, he is ever present and therefore needs no number.\n\nOn the Fool Tarot card, a young man stands on the edge of a cliff, without a care in the world, as he sets out on a new adventure. He is gazing upwards toward the sky (and the Universe) and is seemingly unaware that he is about to skip off a precipice into the unknown. Over his shoulder rests a modest knapsack containing everything he needs \u2013 which isn\u2019t much (let\u2019s say he\u2019s a minimalist). The white rose in his left hand represents his purity and innocence. And at his feet is a small white dog, representing loyalty and protection, that encourages him to charge forward and learn the lessons he came to learn. The mountains behind the Fool symbolise the challenges yet to come. They are forever present, but the Fool doesn\u2019t care about them right now; he\u2019s more focused on starting his expedition.",g6,"card0",[],g6)
L.k(g7,C.c,t).toString
f6=T.l("UPRIGHT: Manifestation, resourcefulness, power, inspired action\n\nREVERSED: Manipulation, poor planning, untapped talents\n\nThe Magician card is numbered One \u2013 the number of new beginnings and opportunities \u2013 and associates with the planet of Mercury. He stands with one arm stretched upwards towards the Universe, and the other pointing down to the earth. His positioning represents his connection between the spiritual realms and the material realms. The Magician uses this relationship to create and manifest his goals in the physical realm. He is the conduit that converts energy into matter. The Magician\u2019s robe is white, symbolising purity, and his cloak is red, representing worldly experience and knowledge.\n\nOn the table in front of him are the four symbols of the Tarot suits \u2013 a cup, pentacle, sword and wand \u2013 each symbolising one of the four elements \u2013 water, earth, air and fire. It is also a sign that he has all the tools (and elements) he needs to manifest his intentions into being. Above his head is the infinity symbol, and around his waist is a snake biting its own tail \u2013 both of which signal that he has access to unlimited potential. And in the foreground is an array of foliage and flowers, symbolising the blossoming and fruition of his ideas and aspirations.",g6,"card1",[],g6)
L.k(g7,C.c,t).toString
f5=T.l("UPRIGHT: Intuition, sacred knowledge, divine feminine, the subconscious mind\n\nREVERSED: Secrets, disconnected from intuition, withdrawal and silence\n\nThe High Priestess sits in front of a thin veil decorated with pomegranates. The veil represents the separate conscious and subconscious realms, the seen and the unseen, and serves to keep casual onlookers out. Only the initiated may enter. The pomegranates on the veil are a symbol of abundance, fertility and the divine feminine, and are sacred to Persephone who ate a pomegranate seed in the underworld and was forced to return every year.\n\nOn either side of the High Priestess stand two pillars, marking the entrance to this sacred, mystical temple (also associated with the Temple of Solomon). One pillar is black with the letter B (Boaz, meaning \u2018in his strength\u2019) and the other is white with the letter J (Jachin, meaning \u2018he will establish\u2019). The black and white colours of the pillars symbolise duality \u2013 masculine and feminine, darkness and light \u2013 stating that knowledge and acceptance of duality are required to enter this sacred space.\n\nThe High Priestess wears a blue robe with a cross on her chest and a horned diadem (or crown), both a symbol of her divine knowledge and her status as a divine ruler. In her lap, she holds a scroll with the letter TORA, signifying the Greater Law (according to A. E. Waite). It is partly covered, signifying that this sacred knowledge is both explicit and implicit, it will only be revealed when the student is ready to look beyond the material realm. The crescent moon at her feet symbolises her connection with the divine feminine, her intuition and subconscious mind, and the natural cycles of the moon.",g6,"card2",[],g6)
L.k(g7,C.c,t).toString
f4=T.l("UPRIGHT: Femininity, beauty, nature, nurturing, abundance\n\nREVERSED: Creative block, dependence on others\n\nThe Empress is a beautiful, full-figured woman with blonde hair and a peaceful aura about her. On her head, she wears a crown of twelve stars, showing her connection with the mystical realm and the cycles of the natural world (the twelve months of the year and the twelve planets). Her robe is patterned with pomegranates, symbolic of fertility, and sits upon a luxurious array of cushions and flowing red velvet. One cushion features the symbol of Venus, the planet of love, creativity, fertility, beauty and grace \u2013 the essence of the Empress.\n\nA beautiful, lush forest and winding stream surround the Empress, signifying her connection with Mother Earth and life itself. She draws her sense of peace from the trees and the water and is rejuvenated by the energy of nature. In the foreground, golden wheat springs from the soil, reflecting abundance from a recent harvest.",g6,"card3",[],g6)
L.k(g7,C.c,t).toString
f3=T.l("UPRIGHT: Authority, establishment, structure, a father figure\n\nREVERSED: Domination, excessive control, lack of discipline, inflexibility\n\nIf the Empress is the Mother archetype of the Tarot deck, the Emperor is the Father. He sits upon a large stone throne, adorned with four rams\u2019 heads (symbolic of his connection with Aries and the planet Mars). In his right hand, the Emperor holds an ankh, the Egyptian symbol of life, and in his left is an orb representing the world over which he rules.\n\nHe wears a red robe, indicative of his power, passion and energy for life. Underneath it, he wears a suit of armour, suggesting that he is protected from any threat (and any emotional response or vulnerability). His long white beard is symbolic of his age-old wisdom and experience, and along with his gold crown, he is an authority figure who demands to be heard.\n\nBehind his throne looms a tall, impenetrable mountain range, signifying that he is backed by a solid foundation but resistant to making any changes unless he deems it necessary. Beneath the peaks flows a small river, giving some hope that despite his tough exterior, he is still an emotional being \u2013 it will just take a lot of digging and trust to open him up to his softer side.",g6,"card4",[],g6)
L.k(g7,C.c,t).toString
f2=T.l("UPRIGHT: Spiritual wisdom, religious beliefs, conformity, tradition,institutions\n\nREVERSED: Personal beliefs, freedom, challenging the status quo\n\nThe Hierophant is the masculine counterpart to the High Priestess. He is also known as the Pope or the Teacher in other Tarot decks and is ruled by Taurus.\n\nThe Hierophant is a religious figure sitting between two pillars of a sacred temple \u2013 though this temple differs from the one in which the High Priestess sits. He wears three robes \u2013 red, blue and white \u2013 and a three-tiered crown, both representing the three worlds over which he rules (the conscious, sub-conscious and super-conscious). In his left hand, he holds the Papal Cross, a triple sceptre that signifies his religious status. He raises his right hand in a religious blessing, with two fingers pointing towards Heaven and two towards Earth.\n\nBefore him kneel two followers. The Hierophant\u2019s task is to pass down his spiritual wisdom and initiate the two into the church so they can take up their appointed roles. This imagery speaks to a shared group identity and a rite of passage to enter the next level. The crossed keys at the Hierophant\u2019s feet represent the balance between the conscious and subconscious minds and the unlocking of mysteries, which only he can teach.",g6,"card5",[],g6)
L.k(g7,C.c,t).toString
f1=T.l("UPRIGHT: Love, harmony, relationships, values alignment, choices\n\nREVERSED: Self-love, disharmony, imbalance, misalignment of values\n\nThe Lovers card shows a naked man and woman standing beneath the angel, Raphael, whose name means \u2018God heals\u2019 and represents both physical and emotional healing. The angel blesses the man and woman and reminds them of their union with the Divine.\n\nThe couple stands in a beautiful, fertile landscape, reminiscent of the Garden of Eden. Behind the woman stands a tall apple tree, with a snake winding its way up the trunk. The serpent and apple tree represent the temptation of sensual pleasures that may take one\u2019s focus away from the Divine. Behind the man is a tree of flames, which represent passion, the primary concern of the man. The twelve flames suggest the twelve zodiac signs, the symbol of time and eternity. The man looks to the woman, who watches the angel, showing the path of the conscious to the subconscious to the super-conscious, or from physical desire to emotional needs to spiritual concerns.\n\nThe volcanic mountain in the background is rather phallic and represents the eruption of passion that happens when man and woman meet in full frontal nudity.",g6,"card6",[],g6)
L.k(g7,C.c,t).toString
f0=T.l("UPRIGHT: Control, willpower, success, action, determination\n\nREVERSED: Self-discipline, opposition, lack of direction\n\nThe Chariot Tarot card shows a brave warrior standing inside a chariot. He wears armour decorated with crescent moons (representing what is coming into being), a tunic with a square (the strength of will) and other alchemical symbols (spiritual transformation). The laurel and star crown signals victory, success and spiritual evolution. Although he appears to be driving the chariot, the charioteer holds no reins \u2013 just a wand like the Magician\u2019s \u2013 symbolising that he controls through the strength of his will and mind.\n\nThe charioteer stands tall \u2013 there\u2019s no sitting down for this guy, as he\u2019s all about taking action and moving forward. Above his head is a canopy of six-pointed stars, suggesting his connection to the celestial world and the Divine will. In front of the vehicle sit a black and a white sphinx, representing duality, positive and negative and, at times, opposing forces. Note how the sphinxes are pulling in opposite directions, but the charioteer uses his willpower and sheer resolve to steer the chariot forward in the direction he wants.\n\nBehind the chariot flows a wide river, symbolic of the need to be \u2018in flow\u2019 with the rhythm of life while also charging ahead toward your goals and intentions.",g6,"card7",[],g6)
L.k(g7,C.c,t).toString
e9=T.l("UPRIGHT: Strength, courage, persuasion, influence, compassion\n\nREVERSED: Inner strength, self-doubt, low energy, raw emotion\n\nIn the Strength Tarot card, a woman gently strokes a lion on its forehead and jaw. Even though it is known for its ferociousness, the woman has tamed this wild beast with her calming, loving energy. The lion is a symbol of raw passions and desires, and in taming him, the woman shows that animal instinct and raw passion can be expressed in positive ways when inner strength and resilience are applied. She doesn\u2019t use force or coercion; she channels her inner strength to subdue and subtly control the lion.\n\nThe woman wears a white robe, showing her purity of spirit, and a belt and crown of flowers that represent the fullest, most beautiful expression of nature. Over her head is the symbol of infinity, representing her infinite potential and wisdom.",g6,"card8",[],g6)
L.k(g7,C.c,t).toString
e8=T.l("UPRIGHT: Soul-searching, introspection, being alone, inner guidance\n\nREVERSED: Isolation, loneliness, withdrawal\n\nThe Hermit stands alone on the top of a mountain. The snow-capped range symbolises his spiritual mastery, growth and accomplishment. He has chosen this path of self-discovery and, as a result, has reached a heightened state of awareness.\n\nIn his right hand, he holds a lantern with a six-pointed star inside; it is the Seal of Solomon, a symbol of wisdom. As the Hermit walks his path, the lamp lights his way \u2013 but it only illuminates his next few steps rather than the full journey. He must step forward to see where to go next, knowing that not everything will be revealed at once. In his left hand, the side of the subconscious mind, the Hermit holds a long staff (a sign of his power and authority), which he uses to guide and balance him.",g6,"card9",[],g6)
L.k(g7,C.c,t).toString
e7=T.l("UPRIGHT: Good luck, karma, life cycles, destiny, a turning point\n\nREVERSED: Bad luck, resistance to change, breaking cycles\n\nThe Wheel of Fortune card shows a giant wheel, with three figures on the outer edges. Four Hebrew letters \u2013 YHVH (Yod Heh Vau Heh), the unpronounceable name of God \u2013 are inscribed on the wheel\u2019s face. There are also the letters TORA, thought to be a version of the word Torah, meaning \u2018law\u2019, or TAROT, or even ROTA (Latin for \u2018wheel\u2019). The middle wheel has the alchemical symbols for mercury, sulphur, water and salt \u2013 the building blocks of life and the four elements \u2013 and represents formative power.\n\nOn the outer circle is a snake, the Egyptian god Typhon (the god of evil), descending on the left side. The snake also represents the life force plunging into the material world. On the right side rises the Anubis, the Egyptian God of the dead who welcomes souls to the underworld. And on top of the wheel sits the Sphinx, representing knowledge and strength.\n\nIn the corners of the Wheel of Fortune card are four winged creatures, each associated with the four fixed signs of the Zodiac: the angel is Aquarius, the eagle is Scorpio, the lion is Leo, and the bull is Taurus. Their wings signify stability amidst movement and change, and each holds the Torah, representing wisdom.",g6,"card10",[],g6)
L.k(g7,C.c,t).toString
e6=T.l("UPRIGHT: Justice, fairness, truth, cause and effect, law\n\nREVERSED: Unfairness, lack of accountability, dishonesty\n\nThe figure of Justice sits in front of a loosely hung purple veil, signifying compassion, and between two pillars, similar to those framing the High Priestess and the Hierophant, which symbolise balance, law and structure.\n\nShe holds a sword in her right hand, showing the logical, well-ordered mindset necessary to dispense fair justice. The sword points upwards \u2013 expressing a firm and final decision \u2013 and the double-edged blade signifies that our actions always carry consequences. The scales in her left (intuitive) hand, show intuition must balance that logic and are a symbol of her impartiality. Justice wears a crown with a small square on it representing well-ordered thoughts, and a red robe with a green mantle. A little white shoe pops out from beneath her clothing as a reminder of the spiritual consequences of your actions.",g6,"card11",[],g6)
L.k(g7,C.c,t).toString
e5=T.l("UPRIGHT: Pause, surrender, letting go, new perspectives\n\nREVERSED: Delays, resistance, stalling, indecision\n\nThe Hanged Man shows a man suspended from a T-shaped cross made of living wood. He is hanging upside-down, viewing the world from a completely different perspective, and his facial expression is calm and serene, suggesting that he is in this hanging position by his own choice. He has a halo around his head, symbolising new insight, awareness and enlightenment. His right foot is bound to the tree, but his left foot remains free, bent at the knee and tucked in behind his right leg. His arms are bent, with hands held behind his back, forming an inverted triangle. The man is wearing red pants representing human passion and the physical body, and a blue vest for knowledge. The Hanged Man is the card of ultimate surrender, of being suspended in time and of martyrdom and sacrifice to the greater good.",g6,"card12",[],g6)
L.k(g7,C.c,t).toString
e4=T.l("UPRIGHT: Endings, change, transformation, transition\n\nREVERSED: Resistance to change, personal transformation, inner purging\n\nThe Death card shows the Messenger of Death \u2013 a skeleton dressed in black armour, riding a white horse. The skeleton represents the part of the body which survives long after life has left it; the armour symbolises invincibility and that death will come no matter what. Its dark colour is that of mourning and the mysterious, while the horse is the colour of purity and acts as a symbol of strength and power. Death carries a black flag decorated with a white, five-petal rose, reflecting beauty, purification and immortality and the number five representing change. Together, these symbols reveal that death isn\u2019t just about life ending. Death is about endings and beginnings, birth and rebirth, change and transformation. There is beauty in death, and it is an inherent part of being alive.\n\nA royal figure appears to be dead on the ground, while a young woman, child and bishop plead with the skeletal figure to spare them. But, as we all know, death spares no one.\n\nIn the background, a boat floats down the river, akin to the mythological boats escorting the dead to the afterlife. On the horizon, the sun sets between two towers (which also appear in the Moon Tarot card), in a sense dying each night and being reborn every morning.",g6,"card13",[],g6)
L.k(g7,C.c,t).toString
e3=T.l("UPRIGHT: Balance, moderation, patience, purpose\n\nREVERSED: Imbalance, excess, self-healing, re-alignment\n\nThe Temperance card shows a large, winged angel who is both masculine and feminine. She wears a light blue robe with a triangle enclosed in a square on the front, representing that humans (the triangle) are bound by the Earth and natural law (square). The angel balances between one foot on the rocks, expressing the need to stay grounded, and one foot in the water, showing the need to be in flow. She pours water between two cups, symbolic of the flow and alchemy of life.\n\nIn the background, there is a winding path up to a mountain range, reflecting the journey through life. Above the mountains hovers a golden crown encased in a glowing light, a symbol of taking the Higher path and staying true to one\u2019s life purpose and meaning.",g6,"card14",[],g6)
L.k(g7,C.c,t).toString
e2=T.l("UPRIGHT: Shadow self, attachment, addiction, restriction, sexuality\n\nREVERSED: Releasing limiting beliefs, exploring dark thoughts, detachment\n\nThe Devil card shows Baphomet, or the Horned Goat of Mendes, a creature that is half man, half goat. Baphomet originally represented the balance between good and evil, male and female, and human and animal; however, more recently, this figure has been linked to the occult and has become a scapegoat for all things considered \u2018evil\u2019.\n\nThe Devil has the wings of a vampire bat, an animal that sucks the lifeblood out of its prey, symbolic of what happens when you give in to your raw desires. He has a hypnotic stare which \u2018magnetises\u2019 and entrances those who come near him, bringing them under his power. Above him is an inverted pentagram \u2013 a sign of the darker side of magic and occultism. He raises his right hand in the Vulcan Salute \u2013 a Jewish blessing, later made famous by the film series, Star Trek. In his left hand, he holds a lit torch.\n\nAt the foot of the Devil stand a man and a woman, both naked and chained to the podium on which the Devil sits. They appear to be held here against their will \u2013 but look closer, and you will notice that the chains around their necks are loose and could be easily removed. Each has small horns on their head, like the devil\u2019s, a sign that they are becoming increasingly like him the longer they stay here. Both have tails, a further symbol of their animalistic tendencies and raw instincts, and the grapes and the fire on their respective tails signify pleasure and lust.",g6,"card15",[],g6)
L.k(g7,C.c,t).toString
e1=T.l("UPRIGHT: Sudden change, upheaval, chaos, revelation, awakening\n\nREVERSED: Personal transformation, fear of change, averting disaster\n\nThe Tower shows a tall tower perched on the top of a rocky mountain. Lightning strikes set the building alight, and two people leap from the windows, head first and arms outstretched. It is a scene of chaos and destruction.\n\nThe Tower itself is a solid structure, but because it has been built on shaky foundations, it only takes one bolt of lightning to bring it down. It represents ambitions and goals made on false premises.\n\nThe lightning represents a sudden surge of energy and insight that leads to a break-through or revelation. It enters via the top of the building and knocks off the crown, symbolising energy flowing down from the Universe, through the crown chakra. The people are desperate to escape from the burning building, not knowing what awaits them as they fall. Around them are 22 flames, representing the 12 signs of the zodiac and 10 points of the Tree of Life, suggesting that even in times of disaster, there is always divine intervention.",g6,"card16",[],g6)
L.k(g7,C.c,t).toString
e0=T.l("UPRIGHT: Hope, faith, purpose, renewal, spirituality\n\nREVERSED: Lack of faith, despair, self-trust, disconnection\n\nThe Star card shows a naked woman kneeling at the edge of a small pool. She holds two containers of water: one in her left hand (the subconscious) and one in her right (the conscious). She pours the water out to nourish the earth and to continue the cycle of fertility, represented by the lush greenery around her. The other container pours the water onto dry land in five rivulets, representing the five senses.\n\nThe woman has one foot on the ground, representing her practical abilities and good common sense, and the other foot in the water, representing her intuition and inner resources and listening to her inner voice. She is naked, representing her vulnerability and purity under the vastness of the starry night sky. Behind her shines one large star, representing her core essences, and seven smaller stars, representing the chakras.",g6,"card17",[],g6)
L.k(g7,C.c,t).toString
d9=T.l("UPRIGHT: Illusion, fear, anxiety, subconscious, intuition\n\nREVERSED: Release of fear, repressed emotion, inner confusion\n\nThe Moon card shows a full moon in the night\u2019s sky, positioned between two large towers. The Moon is a symbol of intuition, dreams, and the unconscious. Its light is dim compared to the sun, and only slightly illuminates the path to higher consciousness winding between the two towers.\n\nIn the foreground is a small pool, representing the watery, subconscious mind. A small crayfish crawls out of the pool, symbolising the early stages of consciousness unfolding. A dog and a wolf stand in the grassy field, howling at the moon, representing both the tamed and the wild aspects of our minds.",g6,"card18",[],g6)
L.k(g7,C.c,t).toString
d8=T.l("UPRIGHT: Positivity, fun, warmth, success, vitality\n\nREVERSED: Inner child, feeling down, overly optimistic\n\nThe Sun Tarot card radiates with optimism and positivity. A large, bright sun shines in the sky, representing the source of all life on Earth. Underneath, four sunflowers grow tall above a brick wall, representing the four suits of the Minor Arcana and the four elements.\n\nIn the foreground, a young, naked child is sitting on top of a calm white horse. The child represents the joy of being connected with your inner spirit, and his nakedness is a sign he has nothing to hide and has all the innocence and purity of childhood. The white horse is also a sign of purity and strength.",g6,"card19",[],g6)
L.k(g7,C.c,t).toString
d7=T.l("UPRIGHT: Judgement, rebirth, inner calling, absolution\n\nREVERSED: Self-doubt, inner critic, ignoring the call\n\nThe Judgement card shows naked men, women, and children rising from their graves, arms outspread and looking up into the sky. Above, Archangel Gabriel \u2013 the Messenger of God \u2013 blows his trumpet. The people respond to his call, ready to be judged and to find out if they will be accepted into the heavens or not. In the background is an extensive mountain range, signifying the insurmountable obstacles and the impossibility of avoiding judgement.",g6,"card20",[],g6)
L.k(g7,C.c,t).toString
d6=T.l("UPRIGHT: Completion, integration, accomplishment, travel\n\nREVERSED: Seeking personal closure, short-cuts, delays\n\nThe World card shows a naked woman wrapped in a purple cloth, dancing inside a large laurel wreath. She looks behind her to the past, while her body moves forward to the future. In her hands are two wands or batons, like the one the Magician holds. It is a symbol that what was manifested with the Magician has now come to completion with the World. The wreath is circular, symbolising a continual cycle of successful completion and new beginnings because, as the woman steps through the wreath, she is completing one phase but beginning another one almost straight away.\n\nAround the wreath are four figures (a lion, bull, cherub and eagle), similar to those in the Wheel of Fortune. Both the World and the Wheel of Fortune speak to the cyclical nature of your life and your progression through its cycles. The four figures represent the four fixed signs of the Zodiac\u2014Leo, Taurus, Aquarius, and Scorpio. They are symbolic of the four elements, the four suits of the Tarot, four compass points, four seasons, and the four corners of the Universe. They are here to guide you from one phase to the next, bringing balance and harmony to your journey.",g6,"card21",[],g6)
L.k(g7,C.c,t).toString
d5=T.l("UPRIGHT: Inspiration, new opportunities, growth, potential\n\nREVERSED: An emerging idea, lack of direction, distractions, delays\n\nIn the Ace of Wands, a hand holding a sprouting wand extends out from a cloud, as if to offer a new opportunity or idea with the potential to grow. The rich, verdant landscape is further confirmation of this growth capability. In the distance on the left sits a castle, representing the promise of opportunities to come, and hills and mountains line the horizon. Their rolling peaks remind us that there will always be challenges along the way, but they are surmountable with enough effort.",g6,"card22",[],g6)
L.k(g7,C.c,t).toString
d4=T.l("UPRIGHT: Future planning, progress, decisions, discovery\n\nREVERSED: Personal goals, inner alignment, fear of unknown, lack of planning\n\nThe Two of Wands shows a man, dressed in a red robe and hat, holding a small globe. The world is literally in his hands, marking the enormous potential before him if he can expand his horizons accordingly. He stands within the confines of his castle, suggesting that while he is contemplating significant opportunities, the man has not yet left his comfort zone to pursue them; he is still very much in the planning phase. His hand rests on an upright wand, and a second wand is affixed to the castle\u2019s wall, a further sign that he is still not ready to venture out. In the background, the land is fertile while also rocky, promising that he has a good chance for success, so long as he can overcome the challenges that will arise.",g6,"card23",[],g6)
L.k(g7,C.c,t).toString
d3=T.l("UPRIGHT: Progress, expansion, foresight, overseas opportunities\n\nREVERSED: Playing small, lack of foresight, unexpected delays\n\nThe Three of Wands depicts a man in red and green robes standing on a cliff with his back turned. Three wands stand firmly planted in the ground, reflecting his commitment to his plans. He has left the comfort of the castle in the Two of Wands and is now in a vast open space, looking out over the sea to distant mountains. He watches three sailing ships pass by, symbolic of movement and progression. From his high vantage point, he can see all that lies ahead, including any upcoming challenges and opportunities.",g6,"card24",[],g6)
L.k(g7,C.c,t).toString
d2=T.l("UPRIGHT: Celebration, joy, harmony, relaxation, homecoming\n\nREVERSED: Personal celebration, inner harmony, conflict with others, transition.\n\nThe Four of Wands shows two happy people dancing and celebrating with flowers in their hands. In the foreground, a beautiful wreath abounding with blossoms and grapes suspends between wands. Together, these elements represent the joy and satisfaction that comes with achieving an important goal or milestone. In the background, another group of people (perhaps a family) stand in front of a large castle, representing the safety and comfort of the home.",g6,"card25",[],g6)
