d1=T.l("UPRIGHT: Conflict, disagreements, competition, tension, diversity\n\nREVERSED: Inner conflict, conflict avoidance, tension release\n\nIn the Five of Wands, five men appear to be fighting each other, using their wands as weapons. However, on closer observation, their wands are raised but not striking or injuring anyone. It is as if there is no real purpose or outcome in this chaotic scene other than to create conflict and sow discord amongst the group. Each man wears a different outfit, symbolising their diverse backgrounds and belief systems, and suggesting that, because of their differences, they cannot find harmony and common ground with one another.",g6,"card26",[],g6)
