d0=T.l("UPRIGHT: Success, public recognition, progress, self-confidence\n\nREVERSED: Private achievement, personal definition of success, fall from grace, egotism\n\nThe Six of Wands depicts a man wearing a victory wreath around his head and riding a decorated white horse through a crowd of cheering people. His horse represents strength, purity and the successful progression of an adventure, and the group of people marks the public recognition for the man\u2019s achievements. The rider holds an upright wand with a wreath tied to the top, further emphasising success and achievement. He is not afraid to show off to others what he has accomplished in his life so far and, even better, the surrounding crowd is delighted to cheer him along.",g6,"card27",[],g6)
