c4=T.l("UPRIGHT: Energy, passion, inspired action, adventure, impulsiveness\n\nREVERSED: Passion project, haste, scattered energy, delays, frustration\n\nThe Knight of Wands sits on his horse in full armour, wearing a yellow robe decorated with salamanders (associated with the element of fire), and a helmet with fiery red plumes flowing behind him. He holds a sprouting wand in his right hand, which symbolises his energy and enthusiasm for his mission. His horse rises up on its hind legs, poised and ready for action. Like all the Wands Court Cards, the background is hot, dry and barren, with mountains soaring in the distance.",g6,"card33",[],g6)
