c3=T.l("UPRIGHT: Courage, confidence, independence, social butterfly, determination\n\nREVERSED: Self-respect, self-confidence, introverted, re-establish sense of self\n\nThe Queen of Wands sits upon a throne decorated with lions facing opposing directions, a symbol of fire and strength. In her left hand, on her crown and behind her are sunflowers, symbolising life, fertility, joy and satisfaction, and her right hand holds a wand with one small sprout springing to life. A black cat sits at her feet, a sign that while this Queen is bold and outgoing she is also in touch with her shadow self \u2013 the darker, lesser-known side of her being.",g6,"card34",[],g6)
