c2=T.l("UPRIGHT: Natural-born leader, vision, entrepreneur, honour\n\nREVERSED: Impulsiveness, haste, ruthless, high expectations\n\nThe King of Wands sits on his throne, holding a blossoming wand in his hand, a symbol of life and creativity. His throne and cape are decorated with lions and salamanders, both symbols of fire and strength. The salamanders biting their own tails represent infinity and the ongoing drive to move forward against all obstacles.",g6,"card35",[],g6)
