c0=T.l("UPRIGHT: Multiple priorities, time management, prioritisation, adaptability.\n\nREVERSED: Over-committed, disorganisation, reprioritisation.\n\nIn the Two of Pentacles, a young man dances while juggling two coins in his hands. The infinity symbol links the coins, suggesting that this man can handle unlimited problems so long as he manages his time, energy and resources well. In the background, two ships sail the high seas, bobbing up and down on the huge waves \u2013 another sign that the ups and downs of life are manageable with focus and attention.",g6,"card37",[],g6)
