b9=T.l("UPRIGHT: Teamwork, collaboration, learning, implementation.\n\nREVERSED: Disharmony, misalignment, working alone.\n\nThe Three of Pentacles shows a young stonemason working with his tools on a portion of a cathedral. In front of him two architects hold the plans for the design. The soaring ceilings and intricate engravings signify that both parties are skilled in their respective crafts. The stonemason appears to be discussing his progress so far with the architects, and even though he is less experienced, they value his opinion and specialist knowledge. Their body language insinuates that this young man is an essential contributor to the cathedral\u2019s completion and the architects want to make sure that everyone is on the same page.",g6,"card38",[],g6)
