b8=T.l("UPRIGHT: Saving money, security, conservatism, scarcity, control.\n\nREVERSED: Over-spending, greed, self-protection.\n\nThe Four of Pentacles shows a man sitting on a stool, beyond the boundaries of his hometown. His arms are wrapped tightly around a coin as if he fears he may lose it if he loosens his grip. He balances another pentacle on his head, impeding his connection with spirit, and two more sit securely underneath his feet. He clearly doesn\u2019t want anyone to take his coins. However, because he is so attached to his money, he can\u2019t move or go anywhere. He has no one to speak to, not even the friends and family members in the community behind him. The man finds himself stuck in one place with a singular fixation: wealth.",g6,"card39",[],g6)
