b7=T.l("UPRIGHT: Financial loss, poverty, lack mindset, isolation, worry.\n\nREVERSED: Recovery from financial loss, spiritual poverty.\n\nIn the Five of Pentacles, two people walk through the icy wind and snow; both are destitute and living in poverty. One man is injured and on crutches, while the other is barefoot and has only a thin blanket to protect him from the bleak winter weather. Behind them sits a church with its lit up and exuding warmth, a symbol of hope, faith and spiritual support. However, because the two people are so focused on their plight, they fail to see that help is available to them and continue on in their desperate journey.",g6,"card40",[],g6)
L.k(g7,C.c,t).toString
b6=T.l("UPRIGHT: Giving, receiving, sharing wealth, generosity, charity.\n\nREVERSED: Self-care, unpaid debts, one-sided charity.\n\nThe Six of Pentacles shows a wealthy man dressed in a red robe, handing out coins to two beggars who kneel at his feet. In his left hand, he holds a balanced scale, representing fairness and equality. This card reflects a state of financial security and generosity, suggesting that you can generously use your wealth and abundance for the benefit of others. But it also speaks to receiving generosity and the feeling of relief that accompanies much-needed assistance. The Six of Pentacles is a card of giving and receiving. Sometimes, you are on the giving end; other times, you are on the receiving end. It\u2019s an ongoing cycle of life, and this card serves as a reminder that the balance can change at any time. Even if you are surrounded by wealth, there will be times when you need the help and support of others, so be generous with your resources, as you may need the support in the future.",g6,"card41",[],g6)
L.k(g7,C.c,t).toString
b5=T.l("UPRIGHT: Long-term view, sustainable results, perseverance, investment.\n\nREVERSED: Lack of long-term vision, limited success or reward.\n\nIn the Seven of Pentacles, a man leans on his hoe, gazing down at his abundant crop. He has worked long and hard to nurture tiny seeds into this thriving garden and can now take a break to enjoy the fruits of his labour. Note the expression in his face, however: he also looks fatigued \u2013 even a little \u2018over it\u2019 \u2013 from having worked so hard for this successful harvest. Success comes from hard work and patience, but this card reminds you to take care not to overdo it and exhaust yourself.",g6,"card42",[],g6)
L.k(g7,C.c,t).toString
b4=T.l("UPRIGHT: Apprenticeship, repetitive tasks, mastery, skill development.\n\nREVERSED: Self-development, perfectionism, misdirected activity.\n\nThe Eight of Pentacles shows a young man labouring over eight coins, carefully etching out a pentacle shape into each coin. In the background, there is a small town, however he has separated himself from the distractions of home life so that he can fully dedicate himself to the task at hand. He is concentrating very hard, eager to do a good job and avoid any mistakes. As he creates each coin, his skills improve and he becomes a master at his craft.",g6,"card43",[],g6)
