b1=T.l("UPRIGHT: Manifestation, financial opportunity, skill development.\n\nREVERSED: Lack of progress, procrastination, learn from failure.\n\nThe Page of Pentacles depicts a young man standing in a grassy field of blooming flowers. In the distance behind him is a small patch of trees and a newly ploughed field, promising an abundant harvest. The mountain range in the horizon signifies the upcoming challenges and obstacles the Page must surmount along his journey. The Page holds a gold coin in his hand and examines it carefully, as if to discover how to manifest even more gold and abundance.",g6,"card46",[],g6)
