b0=T.l("UPRIGHT: Hard work, productivity, routine, conservatism.\n\nREVERSED: Self-discipline, boredom, feeling \u2018stuck\u2019, perfectionism.\n\nThe Knight of Pentacles sits on a stationary draught horse, carefully looking at the gold coin held in his hand. He is in no hurry, preferring to assess and plan his path ahead before taking action. In the background, there is a broad field that has been laboriously ploughed row by row, symbolising that this Knight is ready and willing to do the work to realise his dreams, even if it is repetitive and dull.",g6,"card47",[],g6)
