a9=T.l("UPRIGHT: Nurturing, practical, providing financially, a working parent.\n\nREVERSED: Financial independence, self-care, work-home conflict.\n\nIn the Queen of Pentacles, a woman sits on a stone throne decorated with carvings of fruit trees, goats, angels and other symbols of material success and sensual pleasure. She cradles a gold coin with both hands and looks down on it with loving care, as if to nurture this symbol of wealth and material success. Luscious plants and flowers surround her, representing her connection to Mother Earth, nature, and abundance. A small rabbit jumps near to where she is seated, symbolising fertility and suggesting that her life is in flow and alignment.",g6,"card48",[],g6)
