a8=T.l("UPRIGHT: Wealth, business, leadership, security, discipline, abundance.\n\nREVERSED: Financially inept, obsessed with wealth and status, stubborn.\n\nThe King of Pentacles sits on a throne embellished with carvings of bulls, representing his connection to the astrological sign of Taurus, and grapes and vines adorn his robe, symbolising wealth and abundance. In his right hand, he holds the sceptre of his power, and in his left, he holds a golden coin, symbolic of his material influence. This King has an innate ability to create material wealth and financial abundance \u2013 and better yet, he can sustain his wealth over time through self-discipline, control and leadership.\n\nAt his feet and around his throne are more vines, flowers and plants, representing the highest attainment of material success. His castle sits behind him, a symbol of all he has built through his efforts and determination. This King is therefore very serious about financial security and has made the accumulation of wealth his focus in life. He is proud of his achievements and likes to show others his prized possessions and wealth.",g6,"card49",[],g6)
L.k(g7,C.c,t).toString
a7=T.l("UPRIGHT: Love, new relationships, compassion, creativity.\n\nREVERSED: Self-love, intuition, repressed emotions.\n\nThe Ace of Cups shows a chalice overflowing with five streams of water. The cup represents the vessel of your subconscious mind; the five streams are your five senses and the abundant emotion and intuition flowing from within you. The hand holding the cup is sliding out of the clouds, a symbol of your awareness of spiritual energy and influence. Below the hand is a vast sea covered with lotus blossoms, signifying the awakening of the human spirit. A dove descends towards the cup \u2013 a symbol of Divine love flowing through the subconscious mind to conscious awareness.",g6,"card50",[],g6)
L.k(g7,C.c,t).toString
a6=T.l("UPRIGHT: Unified love, partnership, mutual attraction\n\nREVERSED: Self-love, break-ups, disharmony, distrust.\n\nThe Two of Cups shows a young man and woman, exchanging cups and pledging their love for one another. Above them floats the Caduceus of Hermes \u2013 a winged staff with two snakes wrapped around it \u2013 the ancient symbol of commerce, trade, and exchange. At the top of the caduceus is a lion\u2019s head, signifying passion and fire energy and suggesting that there may be a lot of fiery, sexual energy between these two people.",g6,"card51",[],g6)
