a5=T.l("UPRIGHT: Celebration, friendship, creativity, collaborations.\n\nREVERSED: Independence, alone time, hardcore partying, \u2018three\u2019s a crowd\u2019.\n\nIn the Three of Cups, three young women are dancing with each other in a circle, raising their cups high in the air in a toast of joy and celebration. They look to one another with appreciation, honour and respect, and are bound by their emotional connection and friendship. There is a sense of lifting each other up and celebrating each woman\u2019s unique contribution to the group. The ground is layered with flowers, fruit and a pumpkin, symbolising the celebration of an abundant harvest and the goodness in life.",g6,"card52",[],g6)
