a4=T.l("UPRIGHT: Meditation, contemplation, apathy, reevaluation.\n\nREVERSED: Retreat, withdrawal, checking in for alignment.\n\nThe Four of Cups shows a young man sitting under a tree with his arms crossed, deep in contemplation and meditation. He is so engrossed in his thoughts that he does not seem to notice the outstretched arm offering him a cup. A further three cups stand at his feet, but again, he doesn\u2019t seem to notice or care about these new opportunities either.",g6,"card53",[],g6)
L.k(g7,C.c,t).toString
a3=T.l("UPRIGHT: Regret, failure, disappointment, pessimism.\n\nREVERSED: Personal setbacks, self-forgiveness, moving on.\n\nThe Five of Cups shows a man in a long black cloak looking down on three cups that have been knocked over \u2013 symbolic of his disappointments and failures. Behind him stand two cups representing new opportunities and potential, but because he is so fixed on his losses (the over-turned cups), he misses the opportunities available to him.\n\nIn the background, a bridge crosses a large, flowing river and leads to the security of the castle or home on the opposite side of the riverbank \u2013 if only he can move on from the over-turned cups. The bridge is a message to 'build a bridge and get over it!'",g6,"card54",[],g6)
L.k(g7,C.c,t).toString
a2=T.l("UPRIGHT: Revisiting the past, childhood memories, innocence, joy.\n\nREVERSED: Living in the past, forgiveness, lacking playfulness.\n\nIn the Six of Cups, a young boy leans down and passes a cup filled with flowers to a younger girl. The girl looks up to the boy with love and respect as he offers the flowers to her. Love, harmony and co-operation \u2013 all key elements of the Six of Cups \u2013 shine through this gentle act. The young children also represent childhood memories\n\nIn the background, an older man walks away in the distance, as if to say you no longer need to worry about adult issues; just enjoy the moment of being young, innocent and free again. The children also appear to be standing in the courtyard of a large home, symbolising comfort, safety and security. In the foreground stand four more cups filled with flowers, and a fifth cup sits on a pedestal behind the boy.",g6,"card55",[],g6)
L.k(g7,C.c,t).toString
a1=T.l("UPRIGHT: Opportunities, choices, wishful thinking, illusion.\n\nREVERSED: Alignment, personal values, overwhelmed by choices.\n\nIn the Seven of Cups, a man stands before seven cups filled with various gifts. Some cups bear desirable gifts such as jewels and a wreath of victory. But others hold gifts that are not gifts at all; instead, they are curses, such as the snake or dragon. The clouds and the cups symbolise the man\u2019s wishes and dreams, and the different gifts inside suggest that you need to be careful what you wish for as not everything is as it seems. Choices need to be made, but in doing so, you must go beyond illusion and allure, and instead focus on what\u2019s right for you.",g6,"card56",[],g6)
L.k(g7,C.c,t).toString
a0=T.l("UPRIGHT: Disappointment, abandonment, withdrawal, escapism.\n\nREVERSED: Trying one more time, indecision, aimless drifting, walking away.\n\nIn the Eight of Cups, a man walks away from the eight cups standing in the foreground. The cups are arranged in such a way that it looks like one is missing, a sign that emotional fulfilment and wholeness is lacking. The man has turned his back on these cups with a sense of loss and disappointment and shuffles away into the mountains. A nearby river symbolises his emotions, and the mountains represent the awareness that this will not be an easy journey (though it will be necessary for true long-term happiness). The moon in the night\u2019s sky illuminates the path ahead \u2013 the man is leaving in the dead of night hoping to go unnoticed, suggesting that there may be a level of escape or avoidance in this card.",g6,"card57",[],g6)
L.k(g7,C.c,t).toString
a=T.l("UPRIGHT: Contentment, satisfaction, gratitude, wish come true.\n\nREVERSED: Inner happiness, materialism, dissatisfaction, indulgence.\n\nIn the Nine of Cups, a man sits on a wooden bench. He is comfortable, but not too comfortable (you wouldn\u2019t want to sit on that wooden bench all day!). His arms are crossed, and he has a smile on his face, expressing contentment and satisfaction. Behind him is a curved structure draped in blue material, with nine golden cups arranged in an arch. The cups represent emotional fulfilment after you carry out your deepest desires.",g6,"card58",[],g6)
L.k(g7,C.c,t).toString
b=T.l("UPRIGHT: Divine love, blissful relationships, harmony, alignment.\n\nREVERSED: Disconnection, misaligned values, struggling relationships.\n\nOn the Ten of Cups, a loving couple stands together, arms outstretched, as their two children play nearby. They look towards their home on the hill and a beautiful rainbow in the sky filled with ten cups. These two have true, everlasting love and have everything they could ever wish for \u2013 the home, the kids, and most importantly, fulfilling love \u2013 and they share this bond with the people around them.\n\nThe family home symbolises stability and comfort, while the grassy hills signify fertility and the river marks the flow of emotion. The rainbow signals the end of difficult times and is a sign from the Divine that everything will be okay. The idyllic scene is one of true emotional fulfilment and Divine love.",g6,"card59",[],g6)
L.k(g7,C.c,t).toString
c=T.l("UPRIGHT: Creative opportunities, intuitive messages, curiosity, possibility.\n\nREVERSED: New ideas, doubting intuition, creative blocks, emotional immaturity.\n\nThe Page of Cups wears a blue tunic with a floral print and a beret on his head with a long, flowing scarf. He stands on the shore, with the wavy sea behind him, holding a cup in his right hand. Surprisingly, a fish pops its head out of the cup and looks at the young man. The fish and the sea behind him represent the element of water and all things to do with creativity, intuition, feelings and emotions. The unexpected appearance of the fish signifies that creative inspiration often comes out of the blue and only when you are open to it.",g6,"card60",[],g6)
