e=T.l("UPRIGHT: Compassionate, caring, emotionally stable, intuitive, in flow.\n\nREVERSED: Inner feelings, self-care, self-love, co-dependency.\n\nThe Queen of Cups is a beautiful, introspective woman who sits on a throne at the edge of the sea. In her hands, she holds a golden, cup adorned with handles shaped like angels. Unlike most of the cups in the Suit of Cups cards, this cup is closed \u2013 showing that the Queen\u2019s thoughts and feelings come from her subconscious mind and the depths of her soul.\n\nShe sits upon a stone throne decorated with images of sea-nymphs, fish, and scallop shells. The sea and fish are symbols of the unconscious mind, and water represents emotion, spirit and perception. A cloudless, bright-blue sky and placid water of the sea surround her. Her feet do not touch the water; they rest on colourful pebbles on the shore. It is as if she is connected to her emotions (as represented by the water), but not overwhelmed by them.",g6,"card62",[],g6)
