g=T.l("UPRIGHT: Breakthroughs, new ideas, mental clarity, success\n\nREVERSED: Inner clarity, re-thinking an idea, clouded judgement\n\nThe Ace of Swords shows a gleaming hand appearing from a white cloud, a representation of the Divine. It holds an upright sword, symbolic of the mind and the intellect, and at the tip of the sword sits a crown draped with a wreath, a sign of success and victory. While this Ace is a sign of triumph, the jagged mountains in the background suggest that the road ahead will be challenging. You will need mental resilience to navigate this path.",g6,"card64",[],g6)
