i=T.l("UPRIGHT: Heartbreak, emotional pain, sorrow, grief, hurt\n\nREVERSED: Negative self-talk, releasing pain, optimism, forgiveness\n\nThe Three of Swords shows a heart pierced by three swords, representing the pain inflicted by words, actions and intent on the emotional and physical self. The dark clouds gathering in the background mirror this pain but offer the hope that, just as the storm clouds will disappear, so too will the pain and hurt you are experiencing.",g6,"card66",[],g6)
