j=T.l("UPRIGHT: Rest, relaxation, meditation, contemplation, recuperation\n\nREVERSED: Exhaustion, burn-out, deep contemplation, stagnation\n\nThe Four of Swords shows a knight lying horizontally on a tomb. He remains in his full armour, and his hands are in the position of prayer as a sign of rest. One sword lies beneath the knight, symbolising a single point of focus, and three swords hang above him, pointing downwards towards his head and torso. The stained-glass window above him shows a woman and child together.",g6,"card67",[],g6)
