m=T.l("UPRIGHT: Betrayal, deception, getting away with something, acting strategically\n\nREVERSED: Imposter syndrome, self-deceit, keeping secrets\n\nThe Seven of Swords shows a man sneaking away from a military camp with five swords in his arms. He looks over his shoulder at the two upright swords he has left behind. The smile on his face suggests that he is proud of himself for having slipped away without being noticed.",g6,"card70",[],g6)
