n=T.l("UPRIGHT: Negative thoughts, self-imposed restriction, imprisonment, victim mentality\n\nREVERSED: Self-limiting beliefs, inner critic, releasing negative thoughts, open to new perspectives\n\nThe Eight of Swords shows a woman bound and blindfolded. Eight swords surround her, seemingly trapping her in place, a symbol of the limiting thoughts, beliefs and mindset that prevent her from moving forward in her life. However, look closer: if the woman removed her blindfold, she would quickly realise that she can escape her predicament by letting go of her limiting beliefs and establishing a new, more empowered mindset. The water pooled at her feet suggests that her intuition might see what her eyes cannot.",g6,"card71",[],g6)
