p=T.l("UPRIGHT: Painful endings, deep wounds, betrayal, loss, crisis\n\nREVERSED: Recovery, regeneration, resisting an inevitable end\n\nThe Ten of Swords shows a man lying face down, apparently dead, with ten swords in his back. A red cape drapes over the lower half of his body as a sign of dignity as he leaves this world. While the dark sky is ominous, the sun is rising on the horizon, bringing a renewed sense of hope and opportunity. The calm sea in the background also brings solace, suggesting that even in times of darkness, there is a sense of peace and calm to be found.",g6,"card73",[],g6)
